  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Florida Islands
  Refuge summarizes activities from September through December of 1946. The report
  begins by summarizing the weather conditions during this period. Migratory birds
  for Cedar Keys Refuge, Anclote River Refuge, Indian Key Refuge, Passage Key Refuge,
  Island Bay Refuge, Pine Island Refuge, Matlacha Pass Refuge, Sanibel Island Refuge,
  \ Pelican Island Refuge, and Istokpoga Refuge are also covered. Resource management
  is outlined; topics include commercial fishing. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes violations. N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
